export class LineRangeMapping{constructor(i,e,t){this.originalRange=i,this.modifiedRange=e,this.innerChanges=t}toString(){return`{${this.originalRange.toString()}->${this.modifiedRange.toString()}}`}}export class RangeMapping{constructor(i,e){this.originalRange=i,this.modifiedRange=e}toString(){return`{${this.originalRange.toString()}->${this.modifiedRange.toString()}}`}}export class LineRange{constructor(i,e){this.startLineNumber=i,this.endLineNumberExclusive=e}get isEmpty(){return this.startLineNumber===this.endLineNumberExclusive}toString(){return`[${this.startLineNumber},${this.endLineNumberExclusive})`}join(i){return new LineRange(Math.min(this.startLineNumber,i.startLineNumber),Math.max(this.endLineNumberExclusive,i.endLineNumberExclusive))}}